import React from 'react';
import { Redirect } from 'react-router-dom';
export default function Header(){
    const btn = document.getElementById('btn-mb')
    function toggleMenu(){
        const nav = document.getElementById('navega');
        nav.classList.toggle('active');
    }
    return(
        <div className='topo'>
            <div className='componentes-topo'>
                <p className='logo'>Victor Santos</p>
                <nav id='navega'>
                    <ul id='menu'>
                        <li><Redirect className="Home" to='/'>Home</Redirect></li>
                        <li><Redirect to='/Objetivos' >Objetivos</Redirect></li>
                        <li><Redirect to='/Sobre' className="sobre" >Sobre</Redirect></li>
                        <li><Redirect to='/Contatos' className="Contatos">Contatos</Redirect></li>
                    </ul>
                </nav>
                <button id='btn-mb' className="navbutton" onClick={toggleMenu}>&#9776;</button>
            </div>
       </div>) 
}
